import React,{useEffect,useState} from "react";
import { Component } from "react";

class Foo extends Component {
    render(){
        return (
            <div>foo</div>
        )
    }
}
class Baz extends Component {
    render(){
        return (
            <div>baz</div>
        )
    }
}
const Bar = (props) => {
    return (
        <div>bar</div>
    )
}

const Middle = (props) => {
    return (
        <div>
            <Foo/>
            <Bar/>
            <Baz/>
        </div>
    )
    
}
function App(params){
    return (
        <Middle/>
    )
}
export default App
